-- Carregando Rayfield (não obfuscar)
local Rayfield = loadstring(game:HttpGet('https://sirius.menu/rayfield'))()

-- Criando a janela principal
local Window = Rayfield:CreateWindow({
    Name = 'Felipe Hub',
    LoadingTitle = 'Felipe Auto Farm',
    LoadingSubtitle = 'FlashPoint',
    ConfigurationSaving = {
        Enabled = true,
        FolderName = 'FelipeHub',
        FileName = 'AutoFarmConfig',
    },
    Discord = {
        Enabled = false,
    },
    KeySystem = false,
})

-- Criando a aba principal
local MainTab = Window:CreateTab('Main', 4483362458)

-- Criando função global de notificação segura
local function notify(title, message)
    if Rayfield and Rayfield.Notify then
        Rayfield.Notify(Rayfield, title, message)
    else
        warn("Falha ao notificar: Rayfield.Notify está nil.")
    end
end

